Okay guys, I’ve made the decision we are going forward with this Makers Marker rain or shine! This year has been tough weather wise since it just feels like it’s rained every market weekend but after postponing last Sunday we are just going to hope for the best that it holds out! I decided to move the Makers Market up one hour so we should get a few hours of dry shopping before the rain comes. Please come out and support all the amazing artists and makers that will be there, plus who doesn’t love a handmade gift for the holidays?! Here’s who you can expect to be there ⬇️
@codyzick7 
